#include <iostream>
#include <vector>
using namespace std;

class Solution {
public:
    string shortestPalindrome(string s) {
        int len = s.size();
        int left = 0, right = len - 1;
        while (right >= 0) {
            if (s[left] == s[right]) {
                left++;
            }
            right--;
        }
        if (left == len) {
            return s;
        }
        string r = s.substr(left);
        string re = string(r.rbegin(), r.rend());
        return re + shortestPalindrome(s.substr(0, left)) + r;
    }
};

int main() {
    Solution sol;
    //string s = "aacecaaa";
    //string s = "aacb";
    string s = ""
        ""
        ""
        "";
    cout << sol.shortestPalindrome(s) << endl;
    return 0;
}